/* Procedure structure for procedure `proc_app_role_screen_mapping` */

/*!50003 DROP PROCEDURE IF EXISTS  `proc_app_role_screen_mapping` */;

DELIMITER $$

/*!50003 CREATE DEFINER=`sanjiv`@`%` PROCEDURE `proc_app_role_screen_mapping`(
	p_mode INT(10),
	p_ouId TEXT,
	p_buId TEXT,
	p_roleId TEXT,
	p_moduleMappingId TEXT,
	p_menuId TEXT,
	p_screenId TEXT,
	p_limit INT(10)
    
    )
BEGIN
	
	IF p_mode=0
	   THEN
	   	   DROP  TABLE IF EXISTS `tmp_app_role_screen_mapping`;
	   CREATE  TABLE tmp_app_role_screen_mapping
	   (
	   ouId VARCHAR(250),
	   buId VARCHAR(250),
	   roleId VARCHAR(250),
	   roleView VARCHAR(250),
	   moduleMappingId VARCHAR(250),
	   menuId VARCHAR(350),
	   screenId VARCHAR(250)
	   );
	   INSERT  INTO tmp_app_role_screen_mapping(ouId,buId,roleId,roleView,moduleMappingId,menuId,screenId)
	   SELECT p_ouId,p_buId,p_roleId,'on',p_moduleMappingId,TRIM(SUBSTRING_INDEX(SUBSTRING_INDEX(p_menuId, ',', n.n), ',', -1)),
	      TRIM(SUBSTRING_INDEX(SUBSTRING_INDEX(p_screenId, ',', n.n), ',', -1))
	     
	    FROM
	    (    
	   SELECT a.N + b.N * 10 + 1 n
	    FROM
	   (SELECT 0 AS N UNION ALL SELECT 1 UNION ALL SELECT 2 UNION ALL SELECT 3 UNION ALL SELECT 4 UNION ALL SELECT 5 UNION ALL SELECT 6 UNION ALL SELECT 7 UNION ALL SELECT 8 UNION ALL SELECT 9) a
	  ,(SELECT 0 AS N UNION ALL SELECT 1 UNION ALL SELECT 2 UNION ALL SELECT 3 UNION ALL SELECT 4 UNION ALL SELECT 5 UNION ALL SELECT 6 UNION ALL SELECT 7 UNION ALL SELECT 8 UNION ALL SELECT 9) b
	   ORDER BY n
	) n
	WHERE n.n <= 1 + (LENGTH(p_screenId) - LENGTH(REPLACE(p_screenId, ',', '')))
	AND TRIM(SUBSTRING_INDEX(SUBSTRING_INDEX(p_screenId, ',', n.n), ',', -1));
	INSERT INTO `tbl_app_role_mapping` (ouId,buId,roleId,roleView,moduleMappingId,appMenuId,appScreenId)
	SELECT * FROM tmp_app_role_screen_mapping
	WHERE screenId NOT IN (SELECT appScreenId FROM `tbl_app_role_mapping` WHERE tbl_app_role_mapping.appScreenId=tmp_app_role_screen_mapping.screenId AND 
	tbl_app_role_mapping.appMenuId=tmp_app_role_screen_mapping.menuId AND tbl_app_role_mapping.moduleMappingId=tmp_app_role_screen_mapping.moduleMappingId 
	AND tbl_app_role_mapping.roleId=tmp_app_role_screen_mapping.roleId  );
	  UPDATE tbl_app_role_mapping
	JOIN
	tmp_app_role_screen_mapping
	ON tbl_app_role_mapping.appScreenId=tmp_app_role_screen_mapping.screenId 
	AND tbl_app_role_mapping.appMenuId=tmp_app_role_screen_mapping.menuId
	AND
	tbl_app_role_mapping.moduleMappingId=tmp_app_role_screen_mapping.moduleMappingId
	SET 
		tbl_app_role_mapping.ouId=IFNULL(NULLIF(tmp_app_role_screen_mapping.ouId,''),tbl_app_role_mapping.ouId),
		tbl_app_role_mapping.buId=IFNULL(NULLIF(tmp_app_role_screen_mapping.buId,''),tbl_app_role_mapping.buId),
		tbl_app_role_mapping.roleId=IFNULL(NULLIF(tmp_app_role_screen_mapping.roleId,''),tbl_app_role_mapping.roleId),
		tbl_app_role_mapping.roleView=tmp_app_role_screen_mapping.roleView,
		tbl_app_role_mapping.moduleMappingId=IFNULL(NULLIF(tmp_app_role_screen_mapping.moduleMappingId,''),tbl_app_role_mapping.moduleMappingId),
		tbl_app_role_mapping.appMenuId=IFNULL(NULLIF(tmp_app_role_screen_mapping.menuId,''),tbl_app_role_mapping.appMenuId),
		tbl_app_role_mapping.appScreenId=IFNULL(NULLIF(tmp_app_role_screen_mapping.screenId,''),tbl_app_role_mapping.appScreenId)
		
		
		WHERE tbl_app_role_mapping.appScreenId=tmp_app_role_screen_mapping.screenId and tbl_app_role_mapping.moduleMappingId=tmp_app_role_screen_mapping.moduleMappingId
		and tbl_app_role_mapping.roleId=tmp_app_role_screen_mapping.roleId;
	  UPDATE tbl_app_role_mapping
          SET 
		tbl_app_role_mapping.roleView='off'
		
		WHERE tbl_app_role_mapping.appScreenId NOT IN(
		SELECT screenId FROM `tmp_app_role_screen_mapping` WHERE tbl_app_role_mapping.appScreenId=tmp_app_role_screen_mapping.screenId AND 
	tbl_app_role_mapping.roleId=tmp_app_role_screen_mapping.roleId AND tbl_app_role_mapping.moduleMappingId=tmp_app_role_screen_mapping.moduleMappingId )
	AND roleId=p_roleId AND moduleMappingId=p_moduleMappingId;
		SELECT 'aa';
	END IF;
	
	IF p_mode=3
	THEN
	SELECT t1.*,t2.roleName,t3.screenName,t4.ouname,t5.buname,t7.moduleName 
	FROM `tbl_app_role_mapping`t1
	LEFT JOIN `role` t2 ON t1.roleId=t2.roleId
	LEFT JOIN `tbl_app_screen` t3 ON t1.appScreenId=t3.appScreenId
	LEFT JOIN `ou` t4 ON t1.ouId=t4.ouId
	LEFT JOIN `bu` t5 ON t1.buId=t5.buId
	LEFT JOIN `tbl_ou_bu_module_mapping` t6 ON t1.moduleMappingId=t6.moduleMappingId
	LEFT JOIN  `tbl_module` t7 ON t7.moduleId=t6.moduleId
	WHERE roleView='on' LIMIT p_limit,10;
	END IF;
	
    END */$$
DELIMITER ;

/* Procedure structure for procedure `proc_bu_iud` */

/*!50003 DROP PROCEDURE IF EXISTS  `proc_bu_iud` */;

DELIMITER $$

/*!50003 CREATE DEFINER=`sanjiv`@`%` PROCEDURE `proc_bu_iud`(
	p_mode INT(10),
	p_ouId INT(10),
	p_buId INT(10),
	p_buname VARCHAR(250),
	p_email VARCHAR(250),
	p_limit INT(10),p_address1 VARCHAR(255),
	p_address2 VARCHAR(255),
	p_city VARCHAR(255),
	p_state VARCHAR(255),
	p_country VARCHAR(255),
	p_pin VARCHAR(255), 
	p_mobile VARCHAR(255),
	p_password VARCHAR(255),
	p_firstName VARCHAR(255), 
	p_lastName VARCHAR(255), 
	p_userId INT(11),
	p_offset INT(10)
    )
BEGIN
	IF p_mode=0
	THEN
	
	INSERT INTO `mykmetalivenew`.`bu` (`ouId`, `buname`, `mobile`, `email`, `country`, `state`, `city`, 
	`pin`, `address1`, `address2`, `status`, `createdBy`)
	VALUES(p_ouId,p_buname,p_mobile,p_email,p_country,p_state,p_city,p_pin,
	p_address1,p_address2,'on',p_userId);
	
	INSERT INTO `users`(ouId,buId,roleId,firstName,lastName,mobile,userName,`password`,email,createdBy)
	VALUES(
	(SELECT ouId FROM bu WHERE buId=(SELECT MAX(buId) FROM bu)),
	(SELECT MAX(buId) FROM `bu`),11,p_firstName,p_lastName,p_email,p_email,p_password,p_email,p_userId);
	
	INSERT INTO `mykbizlivenew`.`tbl_employee`(ouId,buId,employeeName,address,city,state,country,email,createdBy)
	VALUES((SELECT ouId FROM bu WHERE buId=(SELECT MAX(buId) FROM bu)),(SELECT MAX(buId) FROM `bu`),CONCAT(p_firstName,' ',p_lastName),
	p_address1,p_city,p_state,p_country,p_email,p_userId
	);
	
	SELECT 'aa';
	END IF;
	
	
	
	IF p_mode=3
	THEN
	SELECT t1.*,IFNULL(t2.ouname,'')ouname,t3.name countryName,t5.name stateName,
	(SELECT CONCAT(IFNULL(firstName,''),' ',IFNULL(lastName,'')) FROM users	WHERE users.roleId=11 AND users.buId=t1.buId)userName FROM `bu` t1
	LEFT JOIN ou t2 ON t1.ouId=t2.ouId 
	LEFT JOIN `mykbizlivenew`.`countries`t3 ON t3.id=t1.country 
	LEFT JOIN `mykbizlivenew`.`states`t5 ON t5.id=t1.state  ORDER BY createdDate DESC  LIMIT p_limit,10;
	END IF;
	
	IF p_mode=1
	THEN
	-- UPDATE bu SET buname=p_buname,email=p_email,ouId=p_ouId WHERE  buId=p_buId;
	
	UPDATE `mykmetalivenew`.`bu` SET `ouId` = p_ouId , `buname` = p_buname , 
	`mobile` = p_mobile, `email` = p_email, `country` = p_country, `state` = p_state, 
	`city` = p_city, `pin` = p_pin, `address1` = p_address1, `address2` = p_address2,
	`updatedBy` = p_userId , `updatedDate` = NOW() WHERE`buId` =p_buId ;
	
	UPDATE users SET firstName=p_firstName,lastName=p_lastName,mobile=p_email,
	`password`=p_password,userName=p_email WHERE buId=p_buId AND roleId=11;
	
	SELECT 'aa';
	END IF;
	
	
	IF p_mode=2
	THEN
	SELECT `t1`.*,`t3`.`firstName`, `t3`.`lastName` ,t3.password
	FROM `bu` `t1` 
	LEFT JOIN `users` `t3` ON `t3`.`ouId` = `t1`.`ouId` AND t3.buId=t1.buId AND roleId=11
	LEFT JOIN `mykbizlivenew`.`countries` `t4` ON `t4`.`id` = `t1`.`country` 
	LEFT JOIN `mykbizlivenew`.`states` `t5` ON `t5`.`id` = `t1`.`state` 
	WHERE `t1`.`buId` =p_buId;
	END IF;
    END */$$
DELIMITER ;

/* Procedure structure for procedure `proc_oubu_iud` */

/*!50003 DROP PROCEDURE IF EXISTS  `proc_oubu_iud` */;

DELIMITER $$

/*!50003 CREATE DEFINER=`sanjiv`@`%` PROCEDURE `proc_oubu_iud`(
	 p_mode INT(10),
	 p_ouId INT(10),
	 p_ouname VARCHAR(50),
	 p_address1 VARCHAR(50),
	 p_address2 VARCHAR(50),
	 p_city VARCHAR(50),
	 p_state VARCHAR(50),
	 p_country VARCHAR(50),
	 p_pin VARCHAR(50),
	 p_emailid VARCHAR(50),
	 p_mobile VARCHAR(50),
	 p_oulogo VARCHAR(50),
	 p_password VARCHAR(50),
	 p_firstName VARCHAR(50),
	 p_lastName VARCHAR(50),
	 p_deleted VARCHAR(50),
	 p_blocked VARCHAR(50),
	 p_limit INT(10)
    
    )
BEGIN
	IF p_mode=0
	THEN
	INSERT INTO `ou`(`ouname`,`address1`, `address2`,`city`,`state`,`country`,`pin`,`emailid`,phone,`oulogo`,`deleted`,`blocked`
	)
	VALUES
	(p_ouname,p_address1,p_address2,p_city,p_state,p_country,p_pin,p_emailid,p_mobile,p_oulogo,p_deleted,p_blocked);
	
	INSERT INTO `bu`(ouId,buname,email,`address1`, `address2`,`city`,`state`,`country`,`pin`) 
	VALUES((SELECT MAX(ouId) FROM ou),'Site Admin',p_emailid,p_address1,p_address2,p_city,p_state,p_country,p_pin);
	
	INSERT INTO `mykbizlivenew`.`tbl_employee`(ouId,buId,employeeName,address,city,state,country,email)
	VALUES((SELECT MAX(ouId) FROM ou),(SELECT MAX(buId) FROM bu WHERE ouId=(SELECT MAX(ouId) FROM ou)),CONCAT(p_firstName,' ',p_lastName),
	p_address1,p_city,p_state,p_country,p_emailid
	);
	INSERT INTO `users`(ouId,buId,roleId,firstName,lastName,mobile,userName,`password`,email)
	VALUES(
	(SELECT MAX(ouId) FROM `ou`),
	(SELECT MAX(buId) FROM `bu`),5,p_firstName,p_lastName,p_emailid,p_emailid,p_password,p_emailid);
	SELECT 'aa';
	END IF;
	
	IF p_mode=3
	THEN
	SELECT t1.*,DATE_FORMAT(t1.createdDate,'%d-%m-%Y')`date`,t3.name countryName,t4.name cityName,t5.name stateName,
	(SELECT buname FROM bu WHERE buId=(SELECT MAX(buId) FROM bu WHERE ouId=t1.ouId))buName,t1.deleted ouDeleted,
	(SELECT CONCAT(firstName,' ',lastName) FROM users WHERE roleId='5' AND users.ouId=t1.ouId AND users.buId=(SELECT MAX(buId) FROM bu WHERE ouId=t1.ouId))userName
	FROM `ou` t1
	LEFT JOIN `mykbizlivenew`.`countries`t3 ON t3.id=t1.country 
	LEFT JOIN `mykbizlivenew`.`cities`t4 ON t4.id=t1.city 
	LEFT JOIN `mykbizlivenew`.`states`t5 ON t5.id=t1.state  ORDER BY createdDate DESC LIMIT p_limit,10;
	END IF;
	
	IF p_mode=1
	THEN
	UPDATE ou SET ouname=p_ouname,address1=p_address1,address2=p_address2,city=p_city,state=p_state,country=p_country,pin=p_pin,emailId=p_emailid
	,oulogo=p_oulogo,phone=p_mobile WHERE ouId=p_ouId;
	-- update bu set email=p_emailid where buId=(select a.buId from(SELECT MAX(buId) buid FROM bu WHERE ouId=p_ouId)a);
	UPDATE users SET firstName=p_firstName,lastName=p_lastName,mobile=p_emailid,`password`=p_password,userName=p_emailid WHERE ouId=p_ouId AND roleId=5;
	SELECT 'aa';
	END IF;
    END */$$
DELIMITER ;

/* Procedure structure for procedure `proc_oubu_module_mapping_iud` */

/*!50003 DROP PROCEDURE IF EXISTS  `proc_oubu_module_mapping_iud` */;

DELIMITER $$

/*!50003 CREATE DEFINER=`sanjiv`@`%` PROCEDURE `proc_oubu_module_mapping_iud`(
	 p_mode INT(10),
	 p_ouId INT(10),
	 p_buId INT(10),
	 p_moduleId INT(10),
	 p_moduleMappingId INT(10),
	 p_limit INT(10)
	
    
    )
BEGIN
	IF p_mode=0
	THEN
	IF NOT EXISTS(SELECT * FROM `tbl_ou_bu_module_mapping` WHERE ouId=p_ouId AND buId=p_buId AND moduleId=p_moduleId AND deleted='off')
	THEN 
	INSERT INTO `tbl_ou_bu_module_mapping`(ouId,buId,moduleId) VALUES(p_ouId,p_buId,p_moduleId);
	SELECT 'OU-BU module mapping added successfully' response;
	ELSE
	SELECT 'This ou-bu module mapping already exists.' response;
	END IF;
	END IF;
	
	IF p_mode=2
	THEN
	SELECT * FROM `tbl_ou_bu_module_mapping` WHERE moduleMappingId=p_moduleMappingId;
	END IF;
	
	IF p_mode=1
	THEN
	UPDATE `tbl_ou_bu_module_mapping` SET ouId=p_ouId,buId=p_buId,moduleId=p_moduleId WHERE moduleMappingId=p_moduleMappingId;
	SELECT 'aa';
	END IF;
	
	IF p_mode=3
	THEN
	SELECT t1.*,t2.ouname,t3.buname,t4.ModuleName,((SELECT COUNT(moduleMappingId) FROM `tbl_web_role_screen_mapping` WHERE moduleMappingId=t1.moduleMappingId)+
		(SELECT COUNT(moduleMappingId) FROM `tbl_app_role_mapping` WHERE moduleMappingId=t1.moduleMappingId))mappingCount FROM `tbl_ou_bu_module_mapping` t1 
	LEFT JOIN `ou` t2 ON t1.ouId=t2.ouId
	LEFT JOIN `bu` t3 ON t1.buId=t3.buId 
	LEFT JOIN `tbl_module` t4 ON t1.moduleId=t4.moduleId  WHERE t1.deleted ='off' LIMIT p_limit,10;
	END IF;
	
    END */$$
DELIMITER ;

/* Procedure structure for procedure `proc_web_role_screen_mapping` */

/*!50003 DROP PROCEDURE IF EXISTS  `proc_web_role_screen_mapping` */;

DELIMITER $$

/*!50003 CREATE DEFINER=`sanjiv`@`%` PROCEDURE `proc_web_role_screen_mapping`(
	p_mode INT(10),
	p_ouId TEXT,
	p_buId TEXT,
	p_roleId TEXT,
	p_moduleMappingId TEXT,
	p_menuId TEXT,
	p_screenId TEXT,
	p_limit INT(10)
    
    )
BEGIN
	
	IF p_mode=0
	   THEN
	   DROP  TABLE IF EXISTS `tmp_web_role_screen_mapping`;
	   CREATE  TABLE tmp_web_role_screen_mapping
	   (
	   roleId VARCHAR(250),
	   roleView VARCHAR(250),
	   moduleMappingId VARCHAR(250),
	   menuId VARCHAR(350),
	   screenId VARCHAR(250)
	   );
	   INSERT  INTO tmp_web_role_screen_mapping(roleId,roleView,moduleMappingId,menuId,screenId)
	   SELECT p_roleId,'on',p_moduleMappingId,TRIM(SUBSTRING_INDEX(SUBSTRING_INDEX(p_menuId, ',', n.n), ',', -1)),
	      TRIM(SUBSTRING_INDEX(SUBSTRING_INDEX(p_screenId, ',', n.n), ',', -1))
	     
	    FROM
	    (    
	   SELECT a.N + b.N * 10 + 1 n
	    FROM
	   (SELECT 0 AS N UNION ALL SELECT 1 UNION ALL SELECT 2 UNION ALL SELECT 3 UNION ALL SELECT 4 UNION ALL SELECT 5 UNION ALL SELECT 6 UNION ALL SELECT 7 UNION ALL SELECT 8 UNION ALL SELECT 9) a
	  ,(SELECT 0 AS N UNION ALL SELECT 1 UNION ALL SELECT 2 UNION ALL SELECT 3 UNION ALL SELECT 4 UNION ALL SELECT 5 UNION ALL SELECT 6 UNION ALL SELECT 7 UNION ALL SELECT 8 UNION ALL SELECT 9) b
	   ORDER BY n
	) n
	WHERE n.n <= 1 + (LENGTH(p_screenId) - LENGTH(REPLACE(p_screenId, ',', '')))
	AND TRIM(SUBSTRING_INDEX(SUBSTRING_INDEX(p_screenId, ',', n.n), ',', -1));
	INSERT INTO `tbl_web_role_screen_mapping` (roleId,roleView,moduleMappingId,menuId,screenId)
	SELECT * FROM tmp_web_role_screen_mapping
	WHERE screenId NOT IN (SELECT screenId FROM `tbl_web_role_screen_mapping` WHERE tbl_web_role_screen_mapping.screenId=tmp_web_role_screen_mapping.screenId AND 
	tbl_web_role_screen_mapping.menuId=tmp_web_role_screen_mapping.menuId AND tbl_web_role_screen_mapping.moduleMappingId=tmp_web_role_screen_mapping.moduleMappingId  
	AND tbl_web_role_screen_mapping.roleId=tmp_web_role_screen_mapping.roleId  );
	  UPDATE tbl_web_role_screen_mapping
	JOIN
	tmp_web_role_screen_mapping
	ON tbl_web_role_screen_mapping.screenId=tmp_web_role_screen_mapping.screenId 
	AND tbl_web_role_screen_mapping.menuId=tmp_web_role_screen_mapping.menuId
	AND
	tbl_web_role_screen_mapping.moduleMappingId=tmp_web_role_screen_mapping.moduleMappingId
	SET 
		tbl_web_role_screen_mapping.roleId=IFNULL(NULLIF(tmp_web_role_screen_mapping.roleId,''),tbl_web_role_screen_mapping.roleId),
		tbl_web_role_screen_mapping.roleView=tmp_web_role_screen_mapping.roleView,
		tbl_web_role_screen_mapping.moduleMappingId=IFNULL(NULLIF(tmp_web_role_screen_mapping.moduleMappingId,''),tbl_web_role_screen_mapping.moduleMappingId),
		tbl_web_role_screen_mapping.menuId=IFNULL(NULLIF(tmp_web_role_screen_mapping.menuId,''),tbl_web_role_screen_mapping.menuId),
		tbl_web_role_screen_mapping.screenId=IFNULL(NULLIF(tmp_web_role_screen_mapping.screenId,''),tbl_web_role_screen_mapping.screenId)
		
		
		WHERE tbl_web_role_screen_mapping.screenId=tmp_web_role_screen_mapping.screenId and tbl_web_role_screen_mapping.roleId=tmp_web_role_screen_mapping.roleId  and 
		tbl_web_role_screen_mapping.moduleMappingId=tmp_web_role_screen_mapping.moduleMappingId;
	  UPDATE tbl_web_role_screen_mapping
          SET 
		tbl_web_role_screen_mapping.roleView='off'
		
		WHERE tbl_web_role_screen_mapping.screenId NOT IN(
		SELECT screenId FROM `tmp_web_role_screen_mapping` WHERE tbl_web_role_screen_mapping.screenId=tmp_web_role_screen_mapping.screenId AND 
	tbl_web_role_screen_mapping.roleId=tmp_web_role_screen_mapping.roleId AND tbl_web_role_screen_mapping.moduleMappingId=tmp_web_role_screen_mapping.moduleMappingId )
	AND roleId=p_roleId AND moduleMappingId=p_moduleMappingId;
		SELECT 'aa';
	END IF;
	
	IF p_mode=3
	THEN
	SELECT t1.*,t2.roleName,t3.screenName ,t5.ouname,t6.buname,t7.moduleName
	FROM `tbl_web_role_screen_mapping` t1
	LEFT JOIN `role` t2 ON t1.roleId=t2.roleId
	LEFT JOIN `tbl_web_screen` t3 ON t1.screenId=t3.screenId
	LEFT JOIN `tbl_ou_bu_module_mapping` t4 ON t1.moduleMappingId=t4.moduleMappingId
	LEFT JOIN `ou` t5 ON t4.ouId=t5.ouId
	LEFT JOIN `bu` t6 ON t4.buId=t6.buId
	LEFT JOIN `tbl_module` t7 ON t4.moduleId=t7.moduleId WHERE roleView='on' LIMIT p_limit,10;
	END IF;
	
    END */$$
DELIMITER ;

